import React, { Component } from 'react';
import './index.css';

class App extends Component {
  useEffect = (() => {
    document.body.classList.add('bg-slate-800')
  })

  render() {
    return (
      <div className='bg-slate-800'>
        <h1 className='text-3xl text-center font-Righteous'>Halo</h1>
      </div>
    )
  }
}

export default App;
